function getGreeting() {
  var dateTime = Date.now();
  var hours = new Date(dateTime).getHours() | 0;
  if (hours < 12) {
    return "Good morning";
  } else if (hours < 18) {
    return "Good afternoon";
  } else {
    return "Good evening";
  }
}

